import './Para.css';

export default function Para(){
    return(
        <div className='p'>
            <a1>Biuro rachunkowe BALANS</a1> powstało z myślą o ludziach, którzy potrzebują pomocy i wsparcia w gąszczu wielu niezrozumiałych przepisów. Nasze biuro powstało, by wesprzeć w opracowaniu dokumentacji  <a1>kadrowej, płacowej i wielu innych obowiązkach </a1>, jakie ciążą na pracodawcach i ich przedsiębiorstwach.
        </div>
    )

}
